import React, { useState } from 'react';

const SearchBox = ({ handleSearch }) => {
  const [searchTerm, setSearchTerm] = useState('');

  const handleChange = (e) => {
    setSearchTerm(e.target.value);
    handleSearch(e.target.value);
  };

  return (
    <input
      type="text"
      placeholder="Search..."
      value={searchTerm}
      onChange={handleChange}
    />
  );
};

const Navbar = () => {
  const [formData, setFormData] = useState({
    accountType: '',
    bankName: '',
    branchName: '',
    accountHolderName: '',
    accountNumber: '',
    bankIFSCCode: '',
    merchantKey: '',
    bankAddress: '',
    Remark: '',
  });

  const [bankAccounts, setBankAccounts] = useState([]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Add the current form data to the bank accounts list
    setBankAccounts([...bankAccounts, formData]);
    // Clear the form data
    setFormData({
      accountType: '',
      bankName: '',
      branchName: '',
      accountHolderName: '',
      accountNumber: '',
      bankIFSCCode: '',
      merchantKey: '',
      bankAddress: '',
      Remark: '',
      UpdatedBy
    });
  };

  const handleSearch = (searchTerm) => {
    // Handle search functionality here
    // You can filter the bank account list based on the search term
    console.log("Searching for:", searchTerm);
  };

  return (
    <div className='containerStyle' style={{ backgroundColor: 'white' }}>
      <div style={{ color: 'black', backgroundColor: '#5DADE2', height: '10vh', display: 'flex', justifyContent: 'space-between', alignItems: 'center', padding: '0 20px' }}>
        <div style={{ display: 'flex', alignItems: 'left' }}>
          <h1 style={{ margin: 0 }}>Account Management</h1>
        </div>
        <div style={{ display: 'flex', alignItems: 'center', height: '100%' }}>
          <label htmlFor="languageSelect" style={{ marginRight: '20px', marginBottom: 0 }}>Language:</label>
          <select id="languageSelect" style={{ height: '20%', marginRight: '20px' }}>
            <option value="english">English</option>
            <option value="hindi">Hindi</option>
          </select>
        </div>
        <a className="nav-link" href="/" style={{ position: 'absolute', left: 0, top: 0 }}>
          {/* Home Icon */}
        </a>
      </div>

      <div style={{ padding: '20px' }}>
        <h2>Bank Account Add</h2>
        <hr style={{ width: '100%', height: '2px', backgroundColor: 'black', margin: '10px 0' }} />

        <form onSubmit={handleSubmit} style={{ display: 'grid', gridTemplateColumns: '1fr 1fr 1fr 1fr', gap: '20px' }}>
          <div style={{ marginBottom: '15px' }}>
            <label htmlFor="accountType">Account Type : </label>
            <input type="text" id="accountType" name="accountType" value={formData.accountType} onChange={handleChange} />
          </div>
          <div style={{ marginBottom: '15px' }}>
            <label htmlFor="bankName">Bank Name : </label>
            <input type="text" id="bankName" name="bankName" value={formData.bankName} onChange={handleChange} />
          </div>
          <div style={{ marginBottom: '15px' }}>
            <label htmlFor="branchName">Branch Name : </label>
            <input type="text" id="branchName" name="branchName" value={formData.branchName} onChange={handleChange} />
          </div>
          <div style={{ marginBottom: '15px' }}>
            <label htmlFor="accountHolderName">Account Holder Name : </label>
            <input type="text" id="accountHolderName" name="accountHolderName" value={formData.accountHolderName} onChange={handleChange} />
          </div>
          <div style={{ marginBottom: '15px' }}>
            <label htmlFor="accountNumber">Account Number : </label>
            <input type="text" id="accountNumber" name="accountNumber" value={formData.accountNumber} onChange={handleChange} />
          </div>
          <div style={{ marginBottom: '15px' }}>
            <label htmlFor="bankIFSCCode">Bank IFSC Code : </label>
            <input type="text" id="bankIFSCCode" name="bankIFSCCode" value={formData.bankIFSCCode} onChange={handleChange} />
          </div>
          <div style={{ marginBottom: '15px' }}>
            <label htmlFor="merchantKey">Merchant Key : </label>
            <input type="text" id="merchantKey" name="merchantKey" value={formData.merchantKey} onChange={handleChange} />
          </div>
          <div style={{ marginBottom: '15px' }}>
            <label htmlFor="bankAddress">Bank Address : </label>
            <input type="text" id="bankAddress" name="bankAddress" value={formData.bankAddress} onChange={handleChange} />
          </div>
          <div style={{ gridColumn: 'span 4', textAlign: 'center' }}>
            <button className="btn btn-outline-success" type="submit">Submit</button>
          </div>
        </form>
      </div>

      <div style={{ backgroundColor: '#5DADE2', height: '10vh', display: 'flex', alignItems: 'left', justifyContent: 'left' }}>
        <h1>Bank Account List</h1>
      </div>

      <div style={{ marginLeft: '1300px' }}>
        {/* Render the SearchBox component here */}
        <SearchBox handleSearch={handleSearch} />
      </div>

      {/* Render the table below */}
      <div style={{ padding: '20px' }}>
        <table style={{ width: '100%' }}>
          <thead>
            <tr>
              <th>Account Type</th>
              <th>Bank Name</th>
              <th>Branch Name</th>
              <th>Account Holder Name</th>
              <th>Account Number</th>
              <th>Bank IFSC Code</th>
              <th>Merchant Key</th>
              <th>Bank Address</th>
              <th>Remark</th>
            </tr>
          </thead>
          <tbody>
            {/* Map through bankAccounts and render each row */}
            {bankAccounts.map((account, index) => (
              <tr key={index}>
                <td>{account.S.No}</td>
                <td>{account.accountType}</td>
                <td>{account.bankName}</td>
                <td>{account.branchName}</td>
                <td>{account.accountHolderName}</td>
                <td>{account.accountNumber}</td>
                <td>{account.bankIFSCCode}</td>
                <td>{account.merchantKey}</td>
                <td>{account.bankAddress}</td>
                <td>{account.Remark}</td>
                <td>{account.UpdatedBy}</td>
                <td>{account.Status}</td>
                
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Navbar;
